const Home = () => {
  return (
    <div id="homeContainer">
        <img src="https://media.istockphoto.com/vectors/female-smiling-librarian-standing-at-counter-vector-id1265171600?k=20&m=1265171600&s=612x612&w=0&h=upKX7yYdzUXprKsV8Me0v3k8fFF5GFitxGeG4Ho6Xbo=" alt="Home page side " />
    </div>
  )
}

export default Home
